import React, {Fragment} from 'react';
import {Outlet, Link} from 'react-router-dom';

const Nav = () => {
   return(
     <Fragment>
      <nav>
        <ul>
         <li><Link to='/'>
         Home</Link></li>
         <li><Link to='/About'>
         About</Link></li>
         <li><Link to='/Contact'>
         ContactNEW</Link></li>
       </ul>
     </nav>
     <Outlet />
     </Fragment>
   )
}
export default Nav;















